import React from "react";
import PropTypes from "prop-types";

const Header = props => {
  return <h1 style={headingStyle}>{props.branding}</h1>;
};

Header.defaultProps = {
  branding: "My App"
};

Header.proptTypes = {
  branding: PropTypes.string.isRequired
};

const headingStyle = {
  color: "red",
  fontSize: "50px"
};

export default Header;
